import React from 'react'

export default function CategoryBar() {
  return (
      <div className='flex flex-row pb-1 justify-evenly items-center h-12 bg-gradient-to-b  from-slate-500 via-slate-100 to-slate-50 font-semibold shadow-xl shadow-slate-600'>
        <div className='text-stone-600 hover:text-black hover:underline underline-offset-4 text-base'><a href="http://localhost:3000/">  Aksiyon  </a></div>
        <div className='text-stone-600 hover:text-black hover:underline underline-offset-4 text-xl'><a href="http://localhost:3000/">  Komedi  </a></div>
        <div className='text-stone-600 hover:text-black hover:underline underline-offset-4 text-xl'><a href="http://localhost:3000/">  Drama  </a></div>
        <div className='text-stone-600 hover:text-black hover:underline underline-offset-4 text-xl'><a href="http://localhost:3000/">  Korku  </a></div>
        <div className='text-stone-600 hover:text-black hover:underline underline-offset-4 text-xl'><a href="http://localhost:3000/">  Bilim-Kurgu  </a></div>
        <div className='text-stone-600 hover:text-black hover:underline underline-offset-4 text-xl'><a href="http://localhost:3000/">  Tarih  </a></div>
      </div>
  )
}
